    false,nt"url": null,nt"notes": "This update has been developed to supplement
    the recommendations in the 1993 recovery plan for the endangered Delmarva Fox Squirrel.
    The conservation strategy presented here is designed to: Provide new information
    regarding this species that has been developed since publication of the 1993 Recovery
    Plan; Guide proactive habitat conservation efforts; Provide a structure for coordinating
    USFWS program activities to increase their effectiveness in helping to recover the
    species; Ensure that projects subject to Section 7 and Section 10 of the Endangered
    Species Act are implemented in a manner that maintains recovery options for the
    species; and to promote research based on priority recovery needs.",nt"license_title":
